import React from "react";
import "../Style/FeturesData.css"
function FeturesData() {
  let data = [
    {
      id: 1,
      name: "paintBrushes",
      img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTTCtiTVjgAul7Ew32PXDGATlMKn3guQHM1pQ&usqp=CAU",
      desc:"Paint your dreams"
    },
    {
      id: 2,
      name: "ChatPapers",
      img: "https://trulyhandpicked.com/wp-content/uploads/2019/02/Colored-Paper-Designs-Craft-Ideas-Decors.webp",
      desc:"create  your imagination"
    },
    {
      id: 3,
      name: "clay-arts",
      img: "https://images-na.ssl-images-amazon.com/images/I/71Zho4Fz4oL._AC_UL900_SR615,900_.jpg",
      desc:" play with clay"
    },
  ];
  return (
    <>
      {data.map((card) => {
        return (
          <>
            <div className="FCards" key={card.id}>
              <img className="image" src={card.img} alt={card.name} />
              
              <h5 className="Name">{card.name}</h5>
              <p className="Desc">{card.desc}</p>
            </div>
          </>
        );
      })}
    </>
  );
}

export default FeturesData;
